            {/* fix the formatting of this */}
            <h2 className="section-title-left">#TimeTravelDebugging</h2>
            <div id="timetravel-container">
                <div>
                    <img src={ TimeTravelGif } alt="GIF demonstrating time travel dubugging"/>
